[{"name": "mcp__togomcp__search_rhea_entity", "input": {"query": "ATP", "limit": 100}}, {"name": "mcp__togomcp__search_uniprot_entity", "input": {"query": "human ATP binding enzyme", "limit": 20}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>

SELECT DISTINCT ?protein ?proteinName ?ecNumber WHERE {
